import Navbar from './components/Navbar';
import Page from './components/Page';
import Card from './components/Card';

function App() {
  return (
    <div>
      <Navbar />
      <Page />
      <Card 
      imgSrc="http://www.sport-et-aventure.fr/wp-content/uploads/2016/01/image-une-airsoft.jpg"


      />
    </div>
  );
}

export default App;
